import { slideInUp,rubberBand } from 'react-animations';
import Radium from 'radium';
export default {
	slideInUp: {
    animation: '0.5s linear',
    animationName: Radium.keyframes(slideInUp, 'slideInUp')
  },
  wobble:{
    animation: '0.5s linear',
    animationName: Radium.keyframes(rubberBand, 'rubberBand')
  }
}
